import React from 'react';
import ResultCard from './components/ResultCard';
import SearchBar from './components/SearchBar';
import { getUserData } from './lib/api';

function App() {
  React.useEffect(() => {
    getUserData("kimyeongseo");
  }, []);

  return (
    <>
      <SearchBar />
      <ResultCard />
    </>
  );
}

export default App;
